import React from 'react';
import '../../App.css';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';


function DormeterCard() {
    return (
        <div className='DormeterCard'>
            <Card style={{ width: '18rem' }}>
                <Card.Img variant="top" src="holder.js/100px180" />
                <Card.Body>
                    <Card.Title>Dormeter</Card.Title>
                    <Card.Text>
                        Dormeter is a website I developed that
                    </Card.Text>
                    <Button variant="primary"><a href = "www.dormeter.com">Go to dormeter.com</a></Button>
                </Card.Body>
            </Card>
        </div>
    );
};

export default DormeterCard;
